import React from 'react';
import { render } from 'react-dom';

const Card = (props) => {
console.log(props);

  return (
    <div>
      <h1>{props.name}</h1>
      <img src={props.img}></img>
      <p>{props.phone}</p>
      <p>{props.email}</p>
    </div>
  )
};

ReactDOM.render(
  <div>
    <Card />
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <div className="top">
          <h2>Beyonce</h2>
          <img
            src="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
            alt="avatar_img"
          />
        </div>
        <div className="bottom">
          <p>+123 456 789</p>
          <p>b@beyonce.com</p>
        </div>
      </div>
    </div>
);


export default Card;
